import React from 'react';

function ThemeToggleButton(props) {
  const { isDarkMode, onToggle } = props;

  return (
    <button onClick={onToggle}>
      {isDarkMode ? 'Light Mode' : 'Dark Mode'}
    </button>
  );
}

export default ThemeToggleButton;
